from evaluation import *

def pretty(d, depth=0):
    print("    "*(depth-1)+"{")
    for key in d.keys():
        print("    "*depth+str(key), end=": ")
        if type(d[key]) != dict:
            print(d[key])
        else:
            pretty(d[key], depth=depth+1)
    print("    "*(depth)+"}")

